import React from "react";

export default function Lexicon() {
  function search(event) {
    event.preventDefault();
    alert("searching");
  }

  return (
    <div className="Lexicon">
      <form onSubmit={search}>
        <input type="search" autoFocus={true} />
      </form>
    </div>
  );
}
